INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 101001, 0, 3, 1, 0, "", 0, 80001, 0, 30, "マホ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 101001, 0, 3, 2, 0, "", 0, 80001, 0, 31, "マホ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 104401, 0, 3, 1, 0, "", 0, 80001, 1, 32, "イリヤ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 104401, 0, 3, 2, 0, "", 0, 80001, 1, 33, "イリヤ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 101701, 0, 3, 1, 0, "", 0, 80001, 2, 34, "カオリ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("これからも、どうぞよろしく\nお願いするさ～！", 101701, 0, 3, 2, 0, "", 0, 80001, 2, 35, "カオリ");
