INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 102801, 0, 4, 2, 0, "", 0, 80001, 0, 37, "サレン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 102501, 0, 4, 1, 0, "", 0, 80001, 1, 38, "スズメ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 102501, 0, 4, 2, 0, "", 0, 80001, 1, 39, "スズメ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("振り返れば、今までいろんなことが\nあったにゃあ…", 104601, 0, 5, 1, 0, "", 0, 80001, 0, 40, "タマキ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 104601, 0, 5, 2, 0, "", 0, 80001, 0, 41, "タマキ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 104801, 0, 5, 1, 0, "", 0, 80001, 1, 42, "ミフユ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 104801, 0, 5, 2, 0, "", 0, 80001, 1, 43, "ミフユ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あなたさまと出会ってもう1年…", 103201, 0, 6, 1, 0, "", 0, 80001, 0, 44, "アキノ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 103201, 0, 6, 2, 0, "", 0, 80001, 0, 45, "アキノ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 103401, 0, 6, 1, 0, "", 0, 80001, 1, 46, "ユカリ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 103401, 0, 6, 2, 0, "", 0, 80001, 1, 47, "ユカリ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 107101, 0, 7, 1, 0, "", 0, 80001, 0, 48, "クリスティーナ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ともかくこれからも\n愉しませてくれよ☆", 107101, 0, 7, 2, 0, "", 0, 80001, 0, 49, "クリスティーナ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 104701, 0, 7, 1, 0, "", 0, 80001, 1, 50, "ジュン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("見えないから分からないって？\nそれもそうだな…", 104701, 0, 7, 2, 0, "", 0, 80001, 1, 51, "ジュン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 103701, 0, 8, 1, 0, "", 0, 80001, 0, 52, "トモ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("これからもよろしくね！", 103701, 0, 8, 2, 0, "", 0, 80001, 0, 53, "トモ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 100501, 0, 8, 1, 0, "", 0, 80001, 1, 54, "マツリ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 100501, 0, 8, 2, 0, "", 0, 80001, 1, 55, "マツリ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("オマエと会って1年なの！\n全然成仏もできなかったし、", 100701, 0, 9, 1, 0, "", 0, 80001, 0, 56, "ミヤコ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 100701, 0, 9, 2, 0, "", 0, 80001, 0, 57, "ミヤコ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 103101, 0, 9, 1, 0, "", 0, 80001, 1, 58, "シノブ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 103101, 0, 9, 2, 0, "", 0, 80001, 1, 59, "シノブ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 100901, 0, 10, 1, 0, "", 0, 80001, 0, 60, "アンナ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 100901, 0, 10, 2, 0, "", 0, 80001, 0, 61, "アンナ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("君と出会ってもう1年だって！\n早いねー！", 101301, 0, 10, 1, 0, "", 0, 80001, 1, 62, "ナナカ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 101301, 0, 10, 2, 0, "", 0, 80001, 1, 63, "ナナカ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 105101, 0, 11, 1, 0, "", 0, 80001, 0, 64, "ミツキ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("これからも、いろんなところを\n調べさせてね？", 105101, 0, 11, 2, 0, "", 0, 80001, 0, 65, "ミツキ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("お前さんと出会ってもう1年か\n助太刀するつもりが", 105601, 0, 11, 1, 0, "", 0, 80001, 1, 66, "ルカ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 105601, 0, 11, 2, 0, "", 0, 80001, 1, 67, "ルカ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("早いものですわね、あなた様と\nお会いして、もう1年…", 102701, 0, 11, 1, 0, "", 0, 80001, 2, 68, "エリコ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 102701, 0, 11, 2, 0, "", 0, 80001, 2, 69, "エリコ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 102301, 0, 12, 1, 0, "", 0, 80001, 0, 70, "アヤネ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 102301, 0, 12, 2, 0, "", 0, 80001, 0, 71, "アヤネ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 104201, 0, 12, 1, 0, "", 0, 80001, 1, 72, "チカ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("私のことを見守ってください\nできることなら、ずっと…", 104201, 0, 12, 2, 0, "", 0, 80001, 1, 73, "チカ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 102101, 0, 12, 1, 0, "", 0, 80001, 2, 74, "クルミ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("で、でもこれからもずっと…\n一緒にいたいなぁ…", 102101, 0, 12, 2, 0, "", 0, 80001, 2, 75, "クルミ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 104901, 0, 13, 1, 0, "", 0, 80001, 0, 76, "シズル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 104901, 0, 13, 2, 0, "", 0, 80001, 0, 77, "シズル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 101101, 0, 13, 1, 0, "", 0, 80001, 1, 78, "リノ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 101101, 0, 13, 2, 0, "", 0, 80001, 1, 79, "リノ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 100201, 0, 14, 1, 0, "", 0, 80001, 0, 80, "ユイ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 100201, 0, 14, 2, 0, "", 0, 80001, 0, 81, "ユイ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("騎士くんと出会って、まだ1年しか\nたってないんだ！？", 100101, 0, 14, 1, 0, "", 0, 80001, 1, 82, "ヒヨリ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 100101, 0, 14, 2, 0, "", 0, 80001, 1, 83, "ヒヨリ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 100301, 0, 14, 1, 0, "", 0, 80001, 2, 84, "レイ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("キミに背中を預けられる日が、\n早くきますように", 100301, 0, 14, 2, 0, "", 0, 80001, 2, 85, "レイ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 105801, 0, 15, 1, 0, "", 0, 80001, 0, 86, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("これからもずっと、覚えていて\nくださいね！", 105801, 0, 15, 2, 0, "", 0, 80001, 0, 87, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 105901, 0, 15, 1, 0, "", 0, 80001, 1, 88, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 105901, 0, 15, 2, 0, "", 0, 80001, 1, 89, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 106001, 0, 15, 1, 0, "", 0, 80001, 2, 90, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 106001, 0, 15, 2, 0, "", 0, 80001, 2, 91, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 112101, 0, 0, 1, 1, "", 0, 60001, 1, 92, "スズメ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 0, 0, 0, 1, "", 1, 60001, 2, 93, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, 0, 0, 1, "", 1, 60001, 2, 94, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 0, 0, 0, 1, "", 1, 60001, 2, 95, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 0, 0, 0, 1, "", 1, 60001, 2, 96, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 0, 0, 0, 2, "", 1, 60001, 2, 97, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 0, 0, 0, 1, "", 2, 60001, 2, 98, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 0, 0, 0, 1, "", 2, 60001, 2, 99, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 0, 0, 0, 1, "", 2, 60001, 2, 100, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 0, 0, 0, 1, "", 2, 60001, 2, 101, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 0, 0, 0, 2, "", 2, 60001, 2, 102, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 0, 0, 0, 1, "", 3, 60001, 2, 103, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 0, 0, 0, 1, "", 3, 60001, 2, 104, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, 0, 0, 1, "", 3, 60001, 2, 105, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, 0, 0, 1, "", 3, 60001, 2, 106, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 0, 0, 0, 0, 1, "", 3, 60001, 2, 107, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 0, 0, 0, 0, 1, "", 3, 60001, 2, 108, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 0, 0, 0, 2, "", 3, 60001, 2, 109, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 0, 0, 0, 1, "", 4, 60001, 2, 110, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 0, 0, 0, 1, "", 4, 60001, 2, 111, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 0, 0, 0, 1, "", 4, 60001, 2, 112, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 0, 0, 0, 1, "", 4, 60001, 2, 113, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 0, 0, 0, 1, "", 4, 60001, 2, 114, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 0, 0, 0, 0, 1, "", 4, 60001, 2, 115, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 0, 0, 0, 2, "", 4, 60001, 2, 116, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 112101, 0, 0, 2, 0, "", 0, 60001, 3, 117, "スズメ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 112101, 0, 7, 3, 0, "", 0, 60001, 3, 118, "スズメ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ヒューヒュー♪\nドンドンパフパフー♪", 105801, 0, 1, 1, 0, "", 0, 80003, 0, 119, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ひゅーひゅー\nどんどんぱふぱふー\nでございます", 105901, 0, 1, 1, 0, "", 0, 80003, 1, 120, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 105901, 0, 1, 2, 0, "", 0, 80003, 1, 121, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("え？　ちょっと\nいきなりなにっ？", 106001, 0, 1, 1, 0, "", 0, 80003, 2, 122, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 106001, 0, 1, 2, 0, "", 0, 80003, 2, 123, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 105801, 0, 1, 2, 0, "", 0, 80003, 0, 124, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 105801, 0, 1, 3, 0, "", 0, 80003, 0, 125, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ですからその日に向けて\n今から気分を盛り上げているのです", 105901, 0, 1, 3, 0, "", 0, 80003, 1, 126, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 106001, 0, 1, 3, 0, "", 0, 80003, 2, 127, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 105901, 0, 1, 4, 0, "", 0, 80003, 1, 128, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 105801, 0, 1, 4, 0, "", 0, 80003, 0, 129, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 106001, 0, 1, 4, 0, "", 0, 80003, 2, 130, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 105901, 0, 1, 5, 0, "", 0, 80003, 1, 131, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 106001, 0, 2, 5, 0, "", 0, 80003, 0, 132, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 190801, 0, 2, 1, 0, "", 0, 80003, 1, 133, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("げっ…カリンじゃない\nなんでもないわよ！", 106001, 0, 2, 6, 0, "", 0, 80003, 0, 134, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 190801, 0, 2, 2, 0, "", 0, 80003, 1, 135, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 106001, 0, 2, 7, 0, "", 0, 80003, 0, 136, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 190801, 0, 2, 3, 0, "", 0, 80003, 1, 137, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 106001, 0, 2, 8, 0, "", 0, 80003, 0, 138, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 106001, 0, 2, 9, 0, "", 0, 80003, 0, 139, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 190801, 0, 2, 4, 0, "", 0, 80003, 1, 140, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 106001, 0, 2, 10, 0, "", 0, 80003, 0, 141, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 190801, 0, 2, 5, 0, "", 0, 80003, 1, 142, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 106001, 0, 2, 11, 0, "", 0, 80003, 0, 143, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 105901, 0, 3, 6, 0, "", 0, 80003, 0, 144, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 105801, 0, 3, 5, 0, "", 0, 80003, 1, 145, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 105901, 0, 3, 7, 0, "", 0, 80003, 0, 146, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 105901, 0, 3, 8, 0, "", 0, 80003, 0, 147, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 105801, 0, 3, 6, 0, "", 0, 80003, 1, 148, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 105801, 0, 3, 7, 0, "", 0, 80003, 1, 149, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あとは、牧場に素敵な温泉が\n出来たとか…", 105901, 0, 3, 9, 0, "", 0, 80003, 0, 150, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 105801, 0, 3, 8, 0, "", 0, 80003, 1, 151, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 105901, 0, 3, 10, 0, "", 0, 80003, 0, 152, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("えへへ、ありがとうございます\nコッコロちゃん！", 105801, 0, 3, 9, 0, "", 0, 80003, 1, 153, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 105901, 0, 3, 11, 0, "", 0, 80003, 0, 154, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 105801, 0, 3, 10, 0, "", 0, 80003, 1, 155, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 105801, 0, 4, 11, 0, "", 0, 80003, 0, 156, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 106001, 0, 4, 12, 0, "", 0, 80003, 1, 157, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 105801, 0, 4, 12, 0, "", 0, 80003, 0, 158, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 106001, 0, 4, 13, 0, "", 0, 80003, 1, 159, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 105801, 0, 4, 13, 0, "", 0, 80003, 0, 160, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("…積極的？\nなんの話よ？", 106001, 0, 4, 14, 0, "", 0, 80003, 1, 161, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 105801, 0, 4, 14, 0, "", 0, 80003, 0, 162, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ムーサの町で\nきゃるきゃる～ん☆　って！", 105801, 0, 4, 15, 0, "", 0, 80003, 0, 163, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 106001, 0, 4, 15, 0, "", 0, 80003, 1, 164, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 105801, 0, 4, 16, 0, "", 0, 80003, 0, 165, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 106001, 0, 4, 16, 0, "", 0, 80003, 1, 166, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 106001, 0, 4, 17, 0, "", 0, 80003, 1, 167, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 106001, 0, 5, 18, 0, "", 0, 80003, 0, 168, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 105901, 0, 5, 12, 0, "", 0, 80003, 1, 169, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 106001, 0, 5, 19, 0, "", 0, 80003, 0, 170, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 105901, 0, 5, 13, 0, "", 0, 80003, 1, 171, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 106001, 0, 5, 20, 0, "", 0, 80003, 0, 172, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 105901, 0, 5, 14, 0, "", 0, 80003, 1, 173, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 106001, 0, 5, 21, 0, "", 0, 80003, 0, 174, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 105901, 0, 5, 15, 0, "", 0, 80003, 1, 175, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("かくし芸？", 106001, 0, 5, 22, 0, "", 0, 80003, 0, 176, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 105901, 0, 5, 16, 0, "", 0, 80003, 1, 177, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 106001, 0, 5, 23, 0, "", 0, 80003, 0, 178, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 105801, 0, 6, 17, 0, "", 0, 80003, 0, 179, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 106001, 0, 6, 24, 0, "", 0, 80003, 2, 180, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 105901, 0, 6, 17, 0, "", 0, 80003, 1, 181, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 105801, 0, 6, 18, 0, "", 0, 80003, 0, 182, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 106001, 0, 6, 25, 0, "", 0, 80003, 2, 183, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 105901, 0, 6, 18, 0, "", 0, 80003, 1, 184, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 106001, 0, 6, 26, 0, "", 0, 80003, 2, 185, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 106001, 0, 6, 27, 0, "", 0, 80003, 2, 186, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 106001, 0, 6, 28, 0, "", 0, 80003, 2, 187, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 105801, 0, 6, 19, 0, "", 0, 80003, 0, 188, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 105901, 0, 6, 19, 0, "", 0, 80003, 1, 189, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 106001, 0, 6, 29, 0, "", 0, 80003, 2, 190, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 106001, 0, 7, 30, 0, "", 0, 80003, 0, 191, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 106001, 0, 7, 31, 0, "", 0, 80003, 0, 192, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 106001, 0, 7, 32, 0, "", 0, 80003, 0, 193, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あー\nあー\n…声、これで大丈夫かしら？", 106001, 0, 7, 33, 0, "", 0, 80003, 0, 194, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 106001, 0, 7, 34, 0, "", 0, 80003, 0, 195, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("オイッスー☆", 106001, 0, 7, 35, 0, "", 0, 80003, 0, 196, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("……\nいや、ないわ\nいつもどおりが一番ね、うん", 106001, 0, 7, 36, 0, "", 0, 80003, 0, 197, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 106001, 0, 7, 37, 0, "", 0, 80003, 0, 198, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ど、どど、どうしよう！？\n緊張してきちゃった…！！", 106001, 0, 7, 38, 0, "", 0, 80003, 0, 199, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 105901, 0, 8, 20, 0, "", 0, 80003, 0, 200, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 105901, 0, 8, 21, 0, "", 0, 80003, 0, 201, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 105901, 0, 8, 22, 0, "", 0, 80003, 0, 202, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 105901, 0, 8, 23, 0, "", 0, 80003, 0, 203, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 105901, 0, 8, 24, 0, "", 0, 80003, 0, 204, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("オイッスー☆", 105901, 0, 8, 25, 0, "", 0, 80003, 0, 205, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 105901, 0, 8, 26, 0, "", 0, 80003, 0, 206, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 105901, 0, 8, 27, 0, "", 0, 80003, 0, 207, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 105901, 0, 8, 28, 0, "", 0, 80003, 0, 208, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("オイッスー☆", 105801, 0, 9, 20, 0, "", 0, 80003, 0, 209, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 105801, 0, 9, 21, 0, "", 0, 80003, 0, 210, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あと６日で2.5周年ですか…", 105801, 0, 9, 22, 0, "", 0, 80003, 0, 211, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 105801, 0, 9, 23, 0, "", 0, 80003, 0, 212, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 105801, 0, 9, 24, 0, "", 0, 80003, 0, 213, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("オイッスー☆", 105801, 0, 9, 25, 0, "", 0, 80003, 0, 214, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 105801, 0, 9, 26, 0, "", 0, 80003, 0, 215, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 105801, 0, 9, 27, 0, "", 0, 80003, 0, 216, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 105801, 0, 9, 28, 0, "", 0, 80003, 0, 217, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 105801, 0, 9, 29, 0, "", 0, 80003, 0, 218, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 105801, 0, 9, 30, 0, "", 0, 80003, 0, 219, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 105801, 0, 10, 31, 0, "", 0, 80003, 0, 220, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 105901, 0, 10, 29, 0, "", 0, 80003, 1, 221, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 105801, 0, 10, 32, 0, "", 0, 80003, 0, 222, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("…………", 106001, 0, 10, 39, 0, "", 0, 80003, 2, 223, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 105901, 0, 10, 30, 0, "", 0, 80003, 1, 224, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 106001, 0, 10, 40, 0, "", 0, 80003, 2, 225, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 105801, 0, 10, 33, 0, "", 0, 80003, 0, 226, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 106001, 0, 10, 41, 0, "", 0, 80003, 2, 227, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 105801, 0, 10, 34, 0, "", 0, 80003, 0, 228, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 105801, 0, 10, 35, 0, "", 0, 80003, 0, 229, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 106001, 0, 10, 42, 0, "", 0, 80003, 2, 230, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 105901, 0, 10, 31, 0, "", 0, 80003, 1, 231, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 106001, 0, 10, 43, 0, "", 0, 80003, 2, 232, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 105801, 0, 10, 36, 0, "", 0, 80003, 0, 233, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 190801, 0, 11, 6, 0, "", 0, 80003, 0, 234, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 190801, 0, 11, 7, 0, "", 0, 80003, 0, 235, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 190801, 0, 11, 8, 0, "", 0, 80003, 0, 236, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 190801, 0, 11, 9, 0, "", 0, 80003, 0, 237, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 190801, 0, 11, 10, 0, "", 0, 80003, 0, 238, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("次にコッコロさんですが\nこちらは発声練習をしています", 190801, 0, 11, 11, 0, "", 0, 80003, 0, 239, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 190801, 0, 11, 12, 0, "", 0, 80003, 0, 240, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 190801, 0, 11, 13, 0, "", 0, 80003, 0, 241, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あれ？\nもしかして緊張で気を失って…？", 190801, 0, 11, 14, 0, "", 0, 80003, 0, 242, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 190801, 0, 11, 15, 0, "", 0, 80003, 0, 243, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 190801, 0, 11, 16, 0, "", 0, 80003, 0, 244, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("それでは\nまた明日お会いしましょう♪", 190801, 0, 11, 17, 0, "", 0, 80003, 0, 245, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 106001, 0, 12, 44, 0, "", 0, 80003, 0, 246, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 105801, 0, 12, 37, 0, "", 0, 80003, 2, 247, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 105901, 0, 12, 32, 0, "", 0, 80003, 1, 248, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 106001, 0, 12, 45, 0, "", 0, 80003, 0, 249, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ひどいですよぉキャルちゃ～ん！", 105801, 0, 12, 38, 0, "", 0, 80003, 2, 250, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 105901, 0, 12, 33, 0, "", 0, 80003, 1, 251, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 105801, 0, 12, 39, 0, "", 0, 80003, 2, 252, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 106001, 0, 12, 46, 0, "", 0, 80003, 0, 253, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 105901, 0, 12, 34, 0, "", 0, 80003, 1, 254, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 105801, 0, 12, 40, 0, "", 0, 80003, 2, 255, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 105801, 0, 13, 41, 0, "", 0, 80003, 0, 256, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 106001, 0, 13, 47, 0, "", 0, 80003, 2, 257, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("忘れてきちゃいました☆", 105801, 0, 13, 42, 0, "", 0, 80003, 0, 258, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 106001, 0, 13, 48, 0, "", 0, 80003, 2, 259, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 105901, 0, 13, 35, 0, "", 0, 80003, 1, 260, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 106001, 0, 13, 49, 0, "", 0, 80003, 2, 261, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 105801, 0, 13, 43, 0, "", 0, 80003, 0, 262, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 106001, 0, 13, 50, 0, "", 0, 80003, 2, 263, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 105901, 0, 13, 36, 0, "", 0, 80003, 1, 264, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 106001, 0, 13, 51, 0, "", 0, 80003, 2, 265, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 105901, 0, 13, 37, 0, "", 0, 80003, 1, 266, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 106001, 0, 13, 52, 0, "", 0, 80003, 2, 267, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 105801, 0, 13, 44, 0, "", 0, 80003, 0, 268, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 105901, 0, 13, 38, 0, "", 0, 80003, 1, 269, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 105801, 0, 13, 45, 0, "", 0, 80003, 0, 270, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 106001, 0, 13, 53, 0, "", 0, 80003, 2, 271, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 105801, 0, 13, 46, 0, "", 0, 80003, 0, 272, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("こんにちは\n【ギルド管理協会】のカリンです", 190801, 0, 14, 18, 0, "", 0, 80003, 0, 273, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("昨日の生放送は\nいかがだったでしょうか？", 190801, 0, 14, 19, 0, "", 0, 80003, 0, 274, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 190801, 0, 14, 20, 0, "", 0, 80003, 0, 275, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 190801, 0, 14, 21, 0, "", 0, 80003, 0, 276, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 190801, 0, 14, 22, 0, "", 0, 80003, 0, 277, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 190801, 0, 14, 23, 0, "", 0, 80003, 0, 278, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 190801, 0, 14, 24, 0, "", 0, 80003, 0, 279, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 190801, 0, 14, 25, 0, "", 0, 80003, 0, 280, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 190801, 0, 14, 26, 0, "", 0, 80003, 0, 281, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 190801, 0, 14, 27, 0, "", 0, 80003, 0, 282, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("準備はいいですかっ？\n…いっきますよー！", 105801, 0, 15, 47, 0, "", 0, 80003, 0, 283, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("祝！", 106001, 0, 15, 54, 0, "", 0, 80003, 2, 284, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("2.5周年！", 105901, 0, 15, 39, 0, "", 0, 80003, 1, 285, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("おめでとうございま～す☆", 105801, 0, 15, 48, 0, "", 0, 80003, 0, 286, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 106001, 0, 15, 55, 0, "", 0, 80003, 2, 287, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 105901, 0, 15, 40, 0, "", 0, 80003, 1, 288, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 105801, 0, 15, 49, 0, "", 0, 80003, 0, 289, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 106001, 0, 15, 56, 0, "", 0, 80003, 2, 290, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 105901, 0, 15, 41, 0, "", 0, 80003, 1, 291, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 106001, 0, 15, 57, 0, "", 0, 80003, 2, 292, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 105801, 0, 15, 50, 0, "", 0, 80003, 0, 293, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 106001, 0, 15, 58, 0, "", 0, 80003, 2, 294, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("記念日だから\n平気平気♪\nやばいですね☆", 105801, 0, 15, 51, 0, "", 0, 80003, 0, 295, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("意味分かんないわよ！", 106001, 0, 15, 59, 0, "", 0, 80003, 2, 296, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 105901, 0, 15, 42, 0, "", 0, 80003, 1, 297, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 105901, 0, 15, 43, 0, "", 0, 80003, 1, 298, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 105801, 0, 15, 52, 0, "", 0, 80003, 0, 299, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 106001, 0, 15, 60, 0, "", 0, 80003, 2, 300, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 105901, 0, 15, 44, 0, "", 0, 80003, 1, 301, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 105801, 0, 15, 53, 0, "", 0, 80003, 0, 302, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("2.5周年\nありがとうございます！", 105801, 1, 15, 54, 0, "105901,45,106001,61", 0, 80003, 0, 303, "ペコリーヌ・コッコロ・キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 190804, 0, 0, 1, 1, "", 0, 60002, 1, 304, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 0, 0, 0, 1, "", 1, 60002, 2, 305, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, 0, 0, 1, "", 1, 60002, 2, 306, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 0, 0, 0, 1, "", 1, 60002, 2, 307, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 0, 0, 0, 1, "", 1, 60002, 2, 308, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 0, 0, 0, 2, "", 1, 60002, 2, 309, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 0, 0, 0, 1, "", 2, 60002, 2, 310, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 0, 0, 0, 1, "", 2, 60002, 2, 311, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 0, 0, 0, 1, "", 2, 60002, 2, 312, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 0, 0, 0, 1, "", 2, 60002, 2, 313, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 0, 0, 0, 2, "", 2, 60002, 2, 314, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 0, 0, 0, 1, "", 3, 60002, 2, 315, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 0, 0, 0, 1, "", 3, 60002, 2, 316, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, 0, 0, 1, "", 3, 60002, 2, 317, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 0, 0, 0, 1, "", 3, 60002, 2, 318, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 0, 0, 0, 0, 1, "", 3, 60002, 2, 319, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, 0, 0, 1, "", 3, 60002, 2, 320, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 0, 0, 0, 0, 2, "", 3, 60002, 2, 321, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 0, 0, 0, 1, "", 4, 60002, 2, 322, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 0, 0, 0, 1, "", 4, 60002, 2, 323, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, 0, 0, 0, 1, "", 4, 60002, 2, 324, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 0, 0, 0, 1, "", 4, 60002, 2, 325, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 0, 0, 0, 1, "", 4, 60002, 2, 326, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, 0, 0, 0, 1, "", 4, 60002, 2, 327, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 0, 0, 0, 2, "", 4, 60002, 2, 328, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 190804, 0, 0, 2, 0, "", 0, 60002, 3, 329, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 190804, 0, 7, 3, 0, "", 0, 60002, 3, 330, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ささ、シェフィさまはこちらへ…", 105901, 0, 1, 1, 0, "", 0, 80005, 4, 331, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("コッコロさん、どこへ行くの…？\n…え？", 106401, 0, 1, 1, 0, "", 0, 80005, 0, 332, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 105801, 0, 1, 1, 0, "", 0, 80005, 3, 333, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 105901, 0, 1, 2, 0, "", 0, 80005, 4, 334, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ええと…\n二人とも何をしているの？", 106401, 0, 1, 2, 0, "", 0, 80005, 0, 335, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 106001, 0, 1, 1, 0, "", 0, 80005, 1, 336, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あの日…？", 106401, 0, 1, 3, 0, "", 0, 80005, 0, 337, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 105801, 0, 1, 2, 0, "", 0, 80005, 3, 338, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("『プリンセスコネクト！\nRe:Dive』3.5周年！", 105801, 0, 1, 3, 0, "", 0, 80005, 3, 339, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("やばいですね☆", 190801, 0, 1, 1, 0, "", 0, 80005, 2, 340, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("って、なにしれっと\n参加してんのよカリン！", 106001, 0, 1, 2, 0, "", 0, 80005, 1, 341, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 190801, 0, 1, 2, 0, "", 0, 80005, 2, 342, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 190801, 0, 1, 3, 0, "", 0, 80005, 2, 343, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 105801, 0, 1, 4, 0, "", 0, 80005, 3, 344, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("えっ！？　ええとええと…！\nあ、あと14日…！", 106401, 0, 1, 4, 0, "", 0, 80005, 0, 345, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 105801, 0, 2, 5, 0, "", 0, 80005, 3, 346, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 105901, 0, 2, 3, 0, "", 0, 80005, 1, 347, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 105901, 0, 2, 4, 0, "", 0, 80005, 1, 348, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 105801, 0, 2, 6, 0, "", 0, 80005, 3, 349, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("さすがでございます\nペコリーヌさま", 105901, 0, 2, 5, 0, "", 0, 80005, 1, 350, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 106001, 0, 2, 3, 0, "", 0, 80005, 0, 351, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("しゃなり、しゃなり…\nふふ、案外できるものね", 106401, 0, 2, 5, 0, "", 0, 80005, 2, 352, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 105801, 0, 2, 7, 0, "", 0, 80005, 3, 353, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("さ、次はキャルさまの\n番でございますよ", 105901, 0, 2, 6, 0, "", 0, 80005, 1, 354, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あ、あたしはいいわよ！\nそういうの全然分かんないし…", 106001, 0, 2, 4, 0, "", 0, 80005, 0, 355, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 106401, 0, 2, 6, 0, "", 0, 80005, 2, 356, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 106001, 0, 2, 5, 0, "", 0, 80005, 0, 357, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("いたたた…もぉお～！\nなんであたしがこんな目に～！", 106001, 0, 2, 6, 0, "", 0, 80005, 0, 358, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 105901, 0, 2, 7, 0, "", 0, 80005, 1, 359, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 106001, 0, 2, 7, 0, "", 0, 80005, 0, 360, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 105901, 0, 3, 8, 0, "", 0, 80005, 1, 361, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 105801, 0, 3, 8, 0, "", 0, 80005, 3, 362, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 105901, 0, 3, 9, 0, "", 0, 80005, 1, 363, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("聖学祭…って、なにかしら？", 106401, 0, 3, 7, 0, "", 0, 80005, 2, 364, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 105901, 0, 3, 10, 0, "", 0, 80005, 1, 365, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 106001, 0, 3, 8, 0, "", 0, 80005, 0, 366, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 106001, 0, 3, 9, 0, "", 0, 80005, 0, 367, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 105801, 0, 3, 9, 0, "", 0, 80005, 3, 368, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("いや、そのまんますぎでしょ…", 106001, 0, 3, 10, 0, "", 0, 80005, 0, 369, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 106401, 0, 3, 8, 0, "", 0, 80005, 2, 370, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 105801, 0, 3, 10, 0, "", 0, 80005, 3, 371, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("えっ？　ええ…\nぎゅーっ…？", 106401, 0, 3, 9, 0, "", 0, 80005, 2, 372, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 106001, 0, 4, 11, 0, "", 0, 80005, 0, 373, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 106401, 0, 4, 10, 0, "", 0, 80005, 2, 374, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 106001, 0, 4, 12, 0, "", 0, 80005, 0, 375, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 105901, 0, 4, 11, 0, "", 0, 80005, 1, 376, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 106001, 0, 4, 13, 0, "", 0, 80005, 0, 377, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 105801, 0, 4, 11, 0, "", 0, 80005, 3, 378, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 106001, 0, 4, 14, 0, "", 0, 80005, 0, 379, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 106001, 0, 4, 15, 0, "", 0, 80005, 0, 380, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 106401, 0, 4, 11, 0, "", 0, 80005, 2, 381, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 105801, 0, 4, 12, 0, "", 0, 80005, 3, 382, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 105901, 0, 4, 12, 0, "", 0, 80005, 1, 383, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 106001, 0, 4, 16, 0, "", 0, 80005, 0, 384, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 106401, 0, 4, 12, 0, "", 0, 80005, 2, 385, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 105801, 0, 5, 13, 0, "", 0, 80005, 3, 386, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 105801, 0, 5, 14, 0, "", 0, 80005, 3, 387, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 105801, 0, 5, 15, 0, "", 0, 80005, 3, 388, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 106001, 0, 5, 17, 0, "", 0, 80005, 0, 389, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 106001, 0, 5, 18, 0, "", 0, 80005, 0, 390, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 106401, 0, 5, 13, 0, "", 0, 80005, 2, 391, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 105901, 0, 5, 13, 0, "", 0, 80005, 1, 392, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 105801, 0, 5, 16, 0, "", 0, 80005, 3, 393, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 106001, 0, 5, 19, 0, "", 0, 80005, 0, 394, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 105801, 0, 5, 17, 0, "", 0, 80005, 3, 395, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 105801, 0, 5, 18, 0, "", 0, 80005, 3, 396, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 105801, 0, 5, 19, 0, "", 0, 80005, 3, 397, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 190801, 0, 6, 4, 0, "", 0, 80005, 2, 398, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 190801, 0, 6, 5, 0, "", 0, 80005, 2, 399, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("…えっ！？", 106001, 0, 6, 20, 0, "", 0, 80005, 1, 400, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 105801, 0, 6, 20, 0, "", 0, 80005, 3, 401, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 106401, 0, 6, 14, 0, "", 0, 80005, 0, 402, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 105901, 0, 6, 14, 0, "", 0, 80005, 4, 403, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 106401, 0, 6, 15, 0, "", 0, 80005, 0, 404, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 106001, 0, 6, 21, 0, "", 0, 80005, 1, 405, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 105801, 0, 6, 21, 0, "", 0, 80005, 3, 406, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ぶっ殺すぞ！？", 106001, 0, 6, 22, 0, "", 0, 80005, 1, 407, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 190801, 0, 6, 6, 0, "", 0, 80005, 2, 408, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 105901, 0, 7, 15, 0, "", 0, 80005, 1, 409, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 106001, 0, 7, 23, 0, "", 0, 80005, 0, 410, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 106401, 0, 7, 16, 0, "", 0, 80005, 2, 411, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 105801, 0, 7, 22, 0, "", 0, 80005, 3, 412, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 106001, 0, 7, 24, 0, "", 0, 80005, 0, 413, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 106401, 0, 7, 17, 0, "", 0, 80005, 2, 414, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 105901, 0, 7, 16, 0, "", 0, 80005, 1, 415, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 106401, 0, 7, 18, 0, "", 0, 80005, 2, 416, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("もちろんでございます\n仲良くお勉強いたしましょう", 105901, 0, 7, 17, 0, "", 0, 80005, 1, 417, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("しれっと教育ママが\n生まれてる…？", 106001, 0, 7, 25, 0, "", 0, 80005, 0, 418, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 105801, 0, 7, 23, 0, "", 0, 80005, 3, 419, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("え～～～～！？", 106001, 0, 7, 26, 0, "", 0, 80005, 0, 420, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 106001, 0, 8, 27, 0, "", 0, 80005, 0, 421, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("…\nねぇコッコロさん\nキャル、どうしちゃったの？", 106401, 0, 8, 19, 0, "", 0, 80005, 2, 422, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 105901, 0, 8, 18, 0, "", 0, 80005, 1, 423, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 105801, 0, 8, 24, 0, "", 0, 80005, 3, 424, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 106401, 0, 8, 20, 0, "", 0, 80005, 2, 425, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 106001, 0, 8, 28, 0, "", 0, 80005, 0, 426, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 105901, 0, 8, 19, 0, "", 0, 80005, 1, 427, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 106401, 0, 8, 21, 0, "", 0, 80005, 2, 428, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 106001, 0, 8, 29, 0, "", 0, 80005, 0, 429, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 106001, 0, 8, 30, 0, "", 0, 80005, 0, 430, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 105801, 0, 8, 25, 0, "", 0, 80005, 3, 431, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 106001, 0, 8, 31, 0, "", 0, 80005, 0, 432, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 106401, 0, 9, 22, 0, "", 0, 80005, 0, 433, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("…えっ？\n生放送の意気込み！？\n突然なに！？", 106401, 0, 9, 23, 0, "", 0, 80005, 0, 434, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 106401, 0, 9, 24, 0, "", 0, 80005, 0, 435, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 106401, 0, 9, 25, 0, "", 0, 80005, 0, 436, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("とにかく落ち着いて\nスタッフさんの指示を聞いて…", 106401, 0, 9, 26, 0, "", 0, 80005, 0, 437, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("それから、それから…！\nぅ、ぅぅっ…！", 106401, 0, 9, 27, 0, "", 0, 80005, 0, 438, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("―びえぇぇ～んっ！！！", 106401, 0, 9, 28, 0, "", 0, 80005, 0, 439, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("どうされましたか、シェフィさま", 105901, 0, 9, 20, 0, "", 0, 80005, 1, 440, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ううっ…ひっく…\nママッ…！", 106401, 0, 9, 29, 0, "", 0, 80005, 0, 441, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 105901, 0, 9, 21, 0, "", 0, 80005, 1, 442, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 105901, 0, 9, 22, 0, "", 0, 80005, 1, 443, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 106401, 0, 9, 30, 0, "", 0, 80005, 0, 444, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("主さま\n3.5周年まであと５日\nでございます", 105901, 0, 10, 23, 0, "", 0, 80005, 0, 445, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ですがその前に\n生放送がありますね", 105901, 0, 10, 24, 0, "", 0, 80005, 0, 446, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("…生放送に向けた\n意気込みでございますか？", 105901, 0, 10, 25, 0, "", 0, 80005, 0, 447, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 105901, 0, 10, 26, 0, "", 0, 80005, 0, 448, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 105901, 0, 10, 27, 0, "", 0, 80005, 0, 449, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 105901, 0, 10, 28, 0, "", 0, 80005, 0, 450, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 105901, 0, 10, 29, 0, "", 0, 80005, 0, 451, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 105901, 0, 10, 30, 0, "", 0, 80005, 0, 452, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 105901, 0, 10, 31, 0, "", 0, 80005, 0, 453, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("3.5周年まであと４日！\nやばいですね☆", 105801, 0, 11, 26, 0, "", 0, 80005, 0, 454, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 106001, 0, 11, 32, 0, "", 0, 80005, 1, 455, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 105801, 0, 11, 27, 0, "", 0, 80005, 0, 456, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 105801, 0, 11, 28, 0, "", 0, 80005, 0, 457, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 105801, 0, 11, 29, 0, "", 0, 80005, 0, 458, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 106001, 0, 11, 33, 0, "", 0, 80005, 1, 459, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 105801, 0, 11, 30, 0, "", 0, 80005, 0, 460, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 105801, 0, 11, 31, 0, "", 0, 80005, 0, 461, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 105801, 0, 11, 32, 0, "", 0, 80005, 0, 462, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("だからあたしはやるなんて一言も…", 106001, 0, 11, 34, 0, "", 0, 80005, 1, 463, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("オイッスー☆", 105801, 0, 11, 33, 0, "", 0, 80005, 0, 464, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("聞きなさいっての！！", 106001, 0, 11, 35, 0, "", 0, 80005, 1, 465, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("3.5周年まであと３日…\nそして生放送は、明日…", 106401, 0, 12, 31, 0, "", 0, 80005, 2, 466, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 106401, 0, 12, 32, 0, "", 0, 80005, 2, 467, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("おいっす！\n…こうじゃなかったわね\nええと確か…", 106401, 0, 12, 33, 0, "", 0, 80005, 2, 468, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 106401, 0, 12, 34, 0, "", 0, 80005, 2, 469, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 106401, 0, 12, 35, 0, "", 0, 80005, 2, 470, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("やってますねシェフィちゃん！", 105801, 0, 12, 34, 0, "", 0, 80005, 3, 471, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("なによ、考えることは\nみんな同じってこと？", 106001, 0, 12, 36, 0, "", 0, 80005, 0, 472, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 105901, 0, 12, 32, 0, "", 0, 80005, 1, 473, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("みんな…もちろんよ！", 106401, 0, 12, 36, 0, "", 0, 80005, 2, 474, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 105801, 0, 12, 35, 0, "", 0, 80005, 3, 475, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 190801, 0, 13, 7, 0, "", 0, 80005, 2, 476, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 190801, 0, 13, 8, 0, "", 0, 80005, 2, 477, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 105801, 0, 13, 36, 0, "", 0, 80005, 3, 478, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 190801, 0, 13, 9, 0, "", 0, 80005, 2, 479, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 105901, 0, 13, 33, 0, "", 0, 80005, 4, 480, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("さすが【美食殿】のママですね！\nそしてキャルさんは…", 190801, 0, 13, 10, 0, "", 0, 80005, 2, 481, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("大丈夫…大丈夫…\nあたしは大丈夫…", 106001, 0, 13, 37, 0, "", 0, 80005, 1, 482, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 190801, 0, 13, 11, 0, "", 0, 80005, 2, 483, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あうー？", 106401, 0, 13, 37, 0, "", 0, 80005, 0, 484, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("あ…", 105801, 1, 13, 37, 0, "105901,34,106001,38,190801,12", 0, 80005, 4, 485, "みんな");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 106001, 0, 13, 39, 0, "", 0, 80005, 1, 486, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 105901, 0, 13, 35, 0, "", 0, 80005, 4, 487, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 105801, 0, 13, 38, 0, "", 0, 80005, 3, 488, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 190801, 0, 13, 13, 0, "", 0, 80005, 2, 489, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 106401, 0, 14, 38, 0, "", 0, 80005, 2, 490, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 105801, 0, 14, 39, 0, "", 0, 80005, 3, 491, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 106001, 0, 14, 40, 0, "", 0, 80005, 0, 492, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 105901, 0, 14, 36, 0, "", 0, 80005, 1, 493, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 106401, 0, 14, 39, 0, "", 0, 80005, 2, 494, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 105801, 0, 14, 40, 0, "", 0, 80005, 3, 495, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 105901, 0, 14, 37, 0, "", 0, 80005, 1, 496, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 106001, 0, 14, 41, 0, "", 0, 80005, 0, 497, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("へ、へぇ…", 106401, 0, 14, 40, 0, "", 0, 80005, 2, 498, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 105801, 0, 14, 41, 0, "", 0, 80005, 3, 499, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 106401, 0, 14, 41, 0, "", 0, 80005, 2, 500, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 106401, 0, 14, 42, 0, "", 0, 80005, 2, 501, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 105801, 0, 15, 42, 0, "", 0, 80005, 3, 502, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("祝！", 106001, 0, 15, 42, 0, "", 0, 80005, 1, 503, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("3.5周年！", 105901, 0, 15, 38, 0, "", 0, 80005, 4, 504, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("おめでとうございます！", 106401, 0, 15, 43, 0, "", 0, 80005, 0, 505, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 190801, 0, 15, 14, 0, "", 0, 80005, 2, 506, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 190801, 0, 15, 15, 0, "", 0, 80005, 2, 507, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 105801, 0, 15, 43, 0, "", 0, 80005, 3, 508, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 105801, 0, 15, 44, 0, "", 0, 80005, 3, 509, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 106001, 0, 15, 43, 0, "", 0, 80005, 1, 510, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 106001, 0, 15, 44, 0, "", 0, 80005, 1, 511, "キャル");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 106401, 0, 15, 44, 0, "", 0, 80005, 0, 512, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 106401, 0, 15, 45, 0, "", 0, 80005, 0, 513, "シェフィ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 105901, 0, 15, 39, 0, "", 0, 80005, 4, 514, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 105901, 0, 15, 40, 0, "", 0, 80005, 4, 515, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 105901, 0, 15, 41, 0, "", 0, 80005, 4, 516, "コッコロ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 105801, 0, 15, 45, 0, "", 0, 80005, 3, 517, "ペコリーヌ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("これからも\nよろしくおねがいします！", 105801, 1, 15, 46, 0, "105901,42,106001,45,106401,46,190801,16", 0, 80005, 4, 518, "みんな");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 190804, 0, 0, 1, 1, "", 0, 60003, 1, 519, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 0, 0, 0, 1, "", 1, 60003, 2, 520, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, 0, 0, 1, "", 1, 60003, 2, 521, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 0, 0, 0, 0, 1, "", 1, 60003, 2, 522, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 0, 0, 0, 0, 1, "", 1, 60003, 2, 523, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 0, 0, 0, 2, "", 1, 60003, 2, 524, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 0, 0, 0, 1, "", 2, 60003, 2, 525, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 0, 0, 0, 1, "", 2, 60003, 2, 526, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 0, 0, 0, 0, 1, "", 2, 60003, 2, 527, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 0, 0, 0, 0, 1, "", 2, 60003, 2, 528, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 0, 0, 0, 2, "", 2, 60003, 2, 529, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 0, 0, 0, 1, "", 3, 60003, 2, 530, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 0, 0, 0, 1, "", 3, 60003, 2, 531, "");
