INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は中吉！　争いごとは勝つが油断は大敵！　　　　　　ま、このあたしと一緒なら、向かうところ敵はねーですよっ！", 0, 0, 0, 0, 2, "", 3, 60005, 2, 589, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は中吉！　ラッキーアイテムは「光るもの」！　　　　ハツネちゃんの「きらーんっ☆」な魔法、見せちゃおうかなっ？", 0, 0, 0, 0, 2, "", 3, 60005, 2, 590, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　のんびり穏やかな一日となるでしょう！　　あなた様を邪魔するものは全てエリコが排除しますわ、クスクス♪", 0, 0, 0, 0, 1, "", 4, 60005, 2, 591, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　小さな勇気で踏み出す一歩が大事！\n遠くから見てるだけじゃダメ。今日は、少しだけ近づいてみます！", 0, 0, 0, 0, 1, "", 4, 60005, 2, 592, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 0, 0, 0, 1, "", 4, 60005, 2, 593, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 0, 0, 0, 1, "", 4, 60005, 2, 594, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 0, 0, 0, 0, 1, "", 4, 60005, 2, 595, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　空を眺めると気持ちが晴れやかに！　　　　眺めるだけじゃなくて、ひとっ飛びしちゃいましょうかっ♪", 0, 0, 0, 0, 2, "", 4, 60005, 2, 596, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は小吉！　掃除をすると運勢が開けそう！　　　　　　「わ、めんど」「ヴルムっ！　新年早々サボっちゃダメなんだからね！」", 0, 0, 0, 0, 2, "", 4, 60005, 2, 597, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 190804, 0, 0, 2, 0, "", 0, 60005, 3, 598, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 190804, 0, 7, 3, 0, "", 0, 60005, 3, 599, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 190804, 0, 0, 1, 1, "", 0, 60006, 1, 600, "カリン");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は姫吉！　勇気を持って、新しいことに挑戦しよう！\n幸先がいいねえ少年！　今年もいい一年になるよう祈ってるよ。", 0, 0, 0, 0, 2, "", 1, 60006, 2, 601, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は姫吉！　どんなピンチも簡単に乗り越えられそう！\nよい結果が出たようで何よりです。さて、待人の方は……ふふ。", 0, 0, 0, 0, 2, "", 1, 60006, 2, 602, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は姫吉！　あの人と仲直り……できちゃうかも！？\nはあ……この私があなたの運勢に興味を抱くわけないでしょう？", 0, 0, 0, 0, 2, "", 1, 60006, 2, 603, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は大吉！　身近な友達との絆が深まる予感……？\n騎士様は、どなたと友誼を結ぶのでしょう？　気になります……", 0, 0, 0, 0, 1, "", 2, 60006, 2, 604, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は大吉！　ラッキーアイテムは「蛇の抜け殻」！\nこのアタシにお目にかかれるなんて……アンタ、幸せものね♪", 0, 0, 0, 0, 2, "", 2, 60006, 2, 605, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は中吉！　気になるあの人に会えちゃうかも！？\n『初夢を正夢にする枕』であなたに会え……な、なんでもない！", 0, 0, 0, 0, 2, "", 3, 60006, 2, 606, "");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("今日の運勢は中吉！　子供に戻って、一日中遊びつくそう！\nお年玉でけん玉ゲット！　おじちゃん、もしかめ一万回やって！", 0, 0, 0, 0, 2, "", 3, 60006, 2, 607, "");
